import React from "react";

const Hero = () => {
  return (
    <section className="relative flex items-center justify-center h-screen bg-center bg-cover" 
      style={{ backgroundImage: "url('https://source.unsplash.com/1600x900/?money,investment')" }}>
      <div className="absolute inset-0 bg-black opacity-50"></div>
      <div className="z-10 text-center text-white" data-aos="fade-up">
        <h1 className="text-4xl font-bold">Maksimalkan Keuntungan <span className="text-green-400">Investasimu!</span></h1>
        <p className="mt-4 text-lg">Kalkulator ROI membantu sebelum mengambil keputusan investasi dalam keuangan.</p>
        <a href="#kalkulator" className="inline-block px-6 py-3 mt-6 text-white bg-yellow-500 rounded-lg shadow-md">
          Hitung ROI Sekarang!
        </a>
      </div>
    </section>
  );
};

export default Hero;
